import style from "./ProductList.module.css"

const ProductList = () => {
    return (
        <div>
            Here will be NFT list
            {
                data.map(nft => <div key={nft.id} className={style.nftBlock}>
                    <img src={nft.imageUrl} className={style.nftImage} />
                    <h3>{nft.name}</h3>
                    <span>Amount: {nft.amount}</span>
                    <p>Price: {nft.price}$</p>

                </div> )
            }
        </div>
    )
}

export default ProductList;
